import React, { useRef } from "react";
import NotebookLogo from "./Notebooklog";

export default function UploadModal({ open , onClose, onUploadFile, onPasteText }) {
  const fileInput = useRef();

  const handleFileSelect = (event) => {
    const file = event.target.files[0];
    if (file) onUploadFile(file);
  };

  const triggerFilePicker = () => fileInput.current.click();

  return (
    <div className="fixed inset-0 bg-black bg-opacity-30 backdrop-blur-sm flex items-center justify-center z-50">
      <div className="bg-white w-[750px] p-8 rounded-2xl shadow-2xl relative max-h-[90vh] overflow-y-auto">

        {/* Close Button */}
        <button
          className="absolute top-5 right-5 text-gray-500 text-2xl hover:text-black"
          onClick={onClose}
        >
          √ó
        </button>

        {/* Header */}
        <div className="flex items-center gap-3 mb-3">
          <NotebookLogo size={32} />
          <h2 className="text-2xl font-semibold">Add sources</h2>
        </div>

        <p className="text-gray-600 mb-6 leading-relaxed">
          Sources let your Notebook base its responses on the information that matters most to you.
          <br />
          <span className="text-gray-500 text-sm">
            (Examples: marketing plans, course readings, transcripts, sales materials, etc.)
          </span>
        </p>

        {/* Drag and Drop Area */}
        <div
          className="border-2 border-dashed border-gray-300 rounded-xl py-16 text-center hover:border-gray-400 transition cursor-pointer"
          onClick={triggerFilePicker}
        >
          <div className="mx-auto mb-4 w-12 h-12 rounded-full bg-blue-50 flex items-center justify-center">
            <svg width="28" height="28" fill="#4F46E5" viewBox="0 0 24 24">
              <path d="M12 2L12 14M12 2L6 8M12 2L18 8" stroke="#4F46E5" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
              <rect x="4" y="14" width="16" height="8" rx="2" stroke="#4F46E5" strokeWidth="2" />
            </svg>
          </div>

          <p className="text-gray-800 font-medium text-lg">Upload sources</p>

          <p className="text-gray-500 mt-2">
            Drag and drop or{" "}
            <span
              className="text-blue-600 cursor-pointer"
              onClick={triggerFilePicker}
            >
              choose file
            </span>
            {" "}to upload
          </p>

          <input
            type="file"
            ref={fileInput}
            onChange={handleFileSelect}
            className="hidden"
          />

          <p className="text-xs text-gray-400 mt-4">
            Supported file types: PDF, TXT, Markdown, Audio (mp3), Images (PNG, JPG, BMP, GIF),
            HEIC, WEBP, ICO, etc.
          </p>
        </div>

        {/* Bottom Options */}
        <div className="grid grid-cols-3 gap-5 mt-10">

          {/* Google Drive */}
          <div className="border p-5 rounded-xl shadow-sm hover:shadow-md cursor-pointer transition">
            <p className="font-medium mb-3">Google Workspace</p>
            <div className="flex items-center gap-2 text-blue-600 font-medium">
              <span>üìÅ</span> Google Drive
            </div>
          </div>

          {/* Link */}
          <div className="border p-5 rounded-xl shadow-sm hover:shadow-md cursor-pointer transition">
            <p className="font-medium mb-3">Link</p>
            <div className="flex flex-col gap-2 text-blue-600 font-medium">
              <span>üîó Website</span>
              <span>‚ñ∂Ô∏è YouTube</span>
            </div>
          </div>

          {/* Paste Text */}
          <div
            onClick={onPasteText}
            className="border p-5 rounded-xl shadow-sm hover:shadow-md cursor-pointer transition"
          >
            <p className="font-medium mb-3">Paste text</p>
            <div className="flex items-center gap-2 text-blue-600 font-medium">
              <span>üìã</span> Copied text
            </div>
          </div>

        </div>
      </div>
    </div>
  );
}
